import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Dashboard from './Pages/Dashboard';
import BruiloftenMenu from './Pages/BruiloftenMenu';
import BuffetMenu from './Pages/BuffetMenu';
import Settings from './Pages/Settings'
import Login from './Pages/Login';
import firebase from 'firebase';


class Router extends React.Component{

    logout = async() => {
        console.log('Logging Out!!');
        await firebase.auth().signOut()
    }

    handleSubmit =(event) => {
        event.preventDefault();
        const email = this.emailRef.current.props.value;
        const password = this.passwordRef.current.props.value;
        firebase.auth().signInWithEmailAndPassword(email, password)
        .then(res => this.props.history.replace('/home'))
        .catch(err => console.log(err));
        event.currentTarget.reset();
    }

    render(){
        return(
            <BrowserRouter>
                <Switch>
                    <Route exact path="/home" component={() => <Dashboard logout={this.logout}/>}/>
                    <Route exact path="/bruiloften" component={BruiloftenMenu}/>
                    <Route exact path="/buffet" component={BuffetMenu}/>
                    <Route exact path="/settings" component={Settings}/>
                    <Route exact path="/login" component={Login}/>
                </Switch>
            </BrowserRouter>
        )
    }
}

export default Router;
